import React from 'react';

import {
    Link,
} from 'react-router-dom';

const Home = () => {
    return <main className="container">
        <article className="home_block">

            <Link to="/BMI" className={["home_btn", "btn-Kids"].join(' ')}>Oblicz BMI </Link>
        </article>
        <article className="home_block">
            <Link to="/PPM"  className={["home_btn", "btn-Women"].join(' ')}>Oblicz PPM </Link>
        </article>
        <article className="home_block">
            <Link to="/CPM" className={["home_btn", "btn-Men"].join(' ')}>Oblicz CPM </Link>
        </article>

        </main>

};

export default Home;
